import{_ as e,o as t,c as o,a}from"./app.edd2a467.js";const w=JSON.parse('{"title":"Frequently Asked Question \u270D","description":"","frontmatter":{},"headers":[],"relativePath":"about/faq.md"}'),i={name:"about/faq.md"},r=a('<h1 id="frequently-asked-question-\u270D" tabindex="-1"><a href="https://github.com/dialogware/www/blob/main/DOCS/FAQ.md" target="_blank" rel="noreferrer">Frequently Asked Question</a> <a href="https://github.com/dialogware/www/edit/main/DOCS/FAQ.md" target="_blank" rel="noreferrer"><span style="font-size:20px;">\u270D</span></a> <a class="header-anchor" href="#frequently-asked-question-\u270D" aria-hidden="true">#</a></h1><p>Different between nocode, lowcode</p><p>What is RPA</p><p>What is Text2Software?</p><p><a href="http://www.text2software.com" target="_blank" rel="noreferrer">www.text2software.com</a></p><p>What is necessary to make this project successful?</p><p>Community is the key. This project provides a solution for many people, but it also offers an opportunity for many more. Each application, library, adapter, robot, and sensor created with compatibility for this system can be made by a third party, and we can help by selling them through our shop. We can also assess security and sign under their project. This project has a great potential for growth if the community decides to use it or make money from it. Each hour spent working on the application for this project serves to automate the process for everyone who already owns this product.Every robot that is compatible with this product has limited working potential. However, it does not require complex logic and tons of sensors to be useful. All of that is managed by our Robo Assistance, which gives the robot a significant advantage over competitors: less logic and sensors means that the robot can be more reliable, cheaper, faster, and easier to produce while still making a lot of things, and those &quot;things&quot; can grow over time, thanks to the application system.</p><p>What are the chances that this project will succeed?</p><p>People need a solution to manage all of this and make it simpler for them to adapt and expand their technological stack. The demand for new technology is high, as is the demand for robotics and smart solutions. Additionally, nobody else is even close (apart from us) to taking advantage of Metaverse&#39;s enormous opportunity to turn virtual reality into reality! However, we are aware of the logistical issues, the rising costs of many dependent elements, and the current global financial crisis. Moreover, just 50% of the world&#39;s population requires such a solution. Another risk is entering the market too soon and missing out on the potential (a problem with the first Mac). Furthermore, this product&#39;s abstract and tool nature make marketing challenges.</p><p>Czym jest a czym nie jest DIALOGWARE?</p><ul><li><p>to idea tworzenia oprogramowania z ju\u017C istniej\u0105cych klock\xF3w-modu\u0142\xF3w opensource</p></li><li><p>nie jest rozwi\u0105zaniem kradn\u0105cym kod, niczym znany #cobot, kt\xF3ry nie respektuje tw\xF3rc\xF3w, \u0142ami\u0105c licencj\u0119 i prywatno\u015B\u0107.</p></li></ul><p>Dlaczego powstaje taka platforma?</p><ul><li>aby pom\xF3c m\u0142odym tw\xF3rcom w nauce j\u0119zyk\xF3w programowania, daj\u0105c im mo\u017Cliwo\u015B\u0107 startu na w\u0142asnym komputerze lokalnie, niezale\u017Cnie od dost\u0119pu do internetu, raz pobrany kod zostaje na komputerze.</li></ul><p>Ile kosztuje dost\u0119p do DIALOGWARE?</p><ul><li>aplikacja do generowania kodu jest darmowa, kosztem s\u0105 zapytania API, kt\xF3re wymagaj\u0105 mocy obliczeniowej, 1 zapytanie to 1 cent USD</li></ul><p>Jakie mo\u017Cliwo\u015Bci stoj\u0105 przed DIALOGWARE?</p><ul><li>w tym roku b\u0119dzie dost\u0119pna wersja testowa aplikacji na komputer do cel\xF3w testowania ju\u017C istniej\u0105cego kodu</li><li>w roku 2023 b\u0119dzie dost\u0119pna mo\u017Cliwo\u015Bci korzystania z wielu marketplace-\xF3w oraz mo\u017Cliwo\u015B\u0107 tworzenia w\u0142asnego.</li></ul><p>Kosztem b\u0119dzie tylko zapytanie, bez miesi\u0119cznych sta\u0142ych koszt\xF3w.</p><p>Jeste\u015Bmy otwarci na pytania, zapraszamy na stron\u0119:</p>',19),s=[r];function n(l,p,c,d,h,m){return t(),o("div",null,s)}const y=e(i,[["render",n]]);export{w as __pageData,y as default};
